function getControlHrmlContent() {
  return '<div id="controlbox"><div id="boxcontainer" class="searchbox searchbox-shadow" > <div class="searchbox-menu-container"><span aria-hidden="true" style="display:none">Menu</span> </div><div><input id="searchboxinput" type="text" style="position: relative;"/></div><div class="searchbox-searchbutton-container"><button aria-label="search" id="searchbox-searchbutton" class="searchbox-searchbutton"></button> <span aria-hidden="true" style="display:none;">search</span> </div></div></div><div class="panel"> <div class="panel-header"> <div class="panel-header-container"> <span class="panel-header-title"></span> <button aria-label="Menu" id="panelbutton" class="panel-close-button"></button> </div></div><div class="panel-content"> </div></div>';
}
function generateHtmlContent(a) {
  for (var b = '<ul class="panel-list">', d = 0; d < a.Items.length; d++) {
    var c = a.Items[d],
      b = b + '<li class="panel-list-item"><div>';
    "link" == c.type
      ? ((b += '<span class="panel-list-item-icon ' + c.icon + '" ></span>'),
        (b += '<a href="' + c.href + '">' + c.name + "</a>"))
      : "button" == c.type &&
        ((b += '<span class="panel-list-item-icon ' + c.icon + '" ></span>'),
        (b += '<button onclick="' + c.onclick + '">' + c.name + "</button>"));
    b += "</li></div>";
  }
  return b + "</ul>";
}
function createSearchboxControl() {
  return L.Control.extend({
    _sideBarHeaderTitle: "Sample Title",
    _sideBarMenuItems: {
      Items: [],
      _searchfunctionCallBack: function(a) {
        alert("calling the default search call back");
      }
    },
    options: { position: "topleft" },
    onAdd: function(a) {
      a = L.DomUtil.create("div");
      a.id = "controlcontainer";
      c = this._searchfunctionCallBack;
      $(a).html(getControlHrmlContent());
      setTimeout(function() {
        $("#searchbox-searchbutton").click(function() {
          var a = $("#searchboxinput").val();
          c(a);
        });
      }, 1);
      L.DomEvent.disableClickPropagation(a);
      return a;
    }
  });
}
